import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import notes from "../notes";

function createCard(all) {
    return <Note 
        title={all.title}
        content={all.content}
    />
}

function App() {
    return <div>
        <Header />
        {notes.map(createCard)}
        <Footer />
    </div>
}

export default App;
